import React from 'react'

const Gamepage = () => {
  return (
    <Game input={userInput} 
            rowLength={rows} 
            colLength={columns} 
            wordle={wordle}
            handleKeyClick={pressKey}
            wordList={wordList}
            socket={socket}/>
  )
}

export default Gamepage
